Build a Rust program that calculates the sum of all even integers between two given numbers. The program should use a for loop to iterate over the range of numbers and a conditional statement to check if the number is even. The program should also use a variable to store the sum of all even numbers and print it at the end.

Solution:
```rust
fn main() {
    let mut sum = 0;

    for i in 1..=100 {
        if i % 2 == 0 {
            sum += i;
        }
    }

    println!("The sum of all even numbers between 1 and 100 is {}", sum);
}
```

